9,347,261,347,262,347,263,346,264,344,266,344,267,344,269,346,271,347,276,347,282,348,285,346,289,344,291,341,294,338,297,333,299,329,300,323,300,318,301,317,302,316,304,313,305,311,305,304,306,297,309,296,313,296,319,297,325,298,331,300,338,302,341,302,344,302,344,300,344,298,340,295,335,292,335,287,335,281,334,281,333,280,333,277,333,274,329,271,325,267,325,265,325,264,321,259,317,255,317,254,317,253,320,252,322,251,322,248,321,245,315,239,310,234,310,231,311,228,313,226,314,224,314,221,314,218,314,215,314,213,328,212,343,212,344,210,346,209,348,206,349,203,350,195,350,188,351,188,352,187,355,189,358,190,361,194,364,197,365,197,366,197,366,193,366,189,369,185,373,182,375,182,378,181,378,177,379,173,380,164,380,154,378,151,375,148,375,147,375,147,373,144,370,141,362,141,355,141,352,142,349,144,344,144,338,143,333,140,327,137,325,137,323,137,323,136,322,135,317,135,312,134,310,132,308,129,308,125,308,122,306,115,305,109,304,108,303,107,282,106,261,106,260,105,259,104,232,104,206,104', 1800, 'The North is vast in size. It is the largest of the Seven Kingdoms'' regions, nearly as large as the the other territories combined.[3] The region is sparsely populated, with vast wilderness, forests, pine-covered hills and snow-capped mountains, speckled with tiny villages and holdfasts. Its climate is cold and harsh in winter and occasionally it will snow in summer. The North has two major land barriers, the Wall to the north and the Neck to the south. The North is bound on each side by major seas, the Shivering Sea to the east and the Sunset Sea to the west.[4] \r\n\r\nWinterfell, the ancestral seat of House Stark, is a large castle centrally located in the North. Nearby is the winter town. The vast wolfswood, the largest forest of the Seven Kingdoms, extends northwest to the Bay of Ice and Sea Dragon Point. Deepwood Motte, the seat of House Glover, and Ironrath, the seat of House Forrester, lie in the wolfswood. House Mormont rules Bear Island in the Bay of Ice. The northern mountains extend from the wolfswood to the Wall and are inhabited by northern mountain clans.[4] Between the mountains and the wolfswood is Highpoint, the seat of House Whitehill.[5] \r\n\r\nSouth of the wolfswood is hilly terrain with several large lakes. Torrhen''s Square, seat of House Tallhart, is located by the largest of these lakes. Farther west along the Sunset Sea is the Stony Shore, which contains fishing villages. Southeast of the Stony Shore and north of Blazewater Bay is the Rills, plains which are ruled by House Ryswell. East of the Rills and south of Winterfell are the barrowlands, hilly plains dotted with the barrows of the First Men. House Dustin rules the large town of Barrowton. There are unnamed rivers which flow south from Barrowton and near Torrhen''s Square into the Saltspear, while another unnamed river divides the Stony Shore from the Rills.[4] \r\n\r\nSouth of the barrowlands is the Neck, an isthmus forming the border with the riverlands to the south. A vast swamp and the source of the Green Fork, the Neck is home to the crannogmen; House Reed rules from the moving castle Greywater Watch.[6] The ruined castle of Moat Cailin, located on the causeway near the Fever River, controls access to the North from the Neck. It is here the Kings in the North held off southron invasions.[7] \r\n\r\nA large peninsula is located west of the Neck and south of the Saltspear and Blazewater Bay. Flint''s Finger, home of House Flint of Flint''s Finger, is located on its northern shore, while Cape Kraken and and the Flint Cliffs are located along its western and southern shores, respectively. South of the peninsula are Ironman''s Bay and the Iron Islands.[8] \r\n\r\nEast of the barrowlands is the White Knife, a major river of the North which has its source at Long Lake northeast of Winterfell. Castle Cerwyn, the seat of House Cerwyn, is located near a tributary south of Winterfell. The White Knife runs south to White Harbor, one of the major cities of the Seven Kingdoms and the main port of the North. Southeast of White Harbor is Oldcastle, the seat of House Locke, while farther east are Ramsgate and the Broken Branch, which has its source in the Sheepshead Hills northeast of White Harbor. Widow''s Watch, the castle of House Flint of Widow''s Watch, is built on an isolated peninsula east of Ramsgate in the Shivering Sea.[4] The Bite separates the southeastern North, much of which is influenced by House Manderly of White Harbor,[9] from the Vale of Arryn. \r\n\r\nHornwood, the seat of House Hornwood, is located north of White Harbor and south of the Dreadfort, the seat of House Bolton. The Dreadfort lies near the Weeping Water, which flows east to the Shivering Sea. Northeast of the Dreadfort are the forested lands of House Karstark. East of their castle, Karhold, are the Grey Cliffs.[4] Located in the Bay of Seals are several islands, including Skagos and uninhabited Skane. The largest, Skagos, is said to be inhabited by cannibals and unicorns and is only nominally controlled by the Starks of Winterfell.[10] \r\n\r\nNorth of Winterfell and the Dreadfort and northwest of Karhold are the lands of House Umber, whose castle of Last Hearth is located in a forest. The Umbers control the Lonely Hills[11] and land along the Bay of Seals.[12] Beginning near Last Hearth, the Last River flows southeast between Karhold and the Dreadfort.[4] \r\n\r\nThe Wall is a colossal fortification that protects the North from threats beyond the Wall, such as wildlings. It is separated from the northern lands owing allegiance to Winterfell by the Gift, which are lands of the Night''s Watch north of the Umbers'' lands. \r\n\r\nWinterfell and Moat Cailin are located along the kingsroad, which connects Castle Black at the Wall with the riverlands to the south.', 'Dawn Age\r\n \r\nBanner for the North illustrated by Tiziano Baracchi. © Fantasy Flight Games.\r\n\r\nThe peoples of the North are nearly all descended from the First Men, who settled the land nearly 12,000 years ago. Little is known of that time, but cryptic runes carved in old stones and the barrows the First Men lived in can still be found in the barrowlands. Ancient forts of the First Men are scattered throughout the North, including a ringfort atop Seal Rock near White Harbor and ruins in Sea Dragon Point. The children of the forest also made weirwood circles.[19] \r\nKings of Winter\r\n\r\nAbout 8,000 years ago, the Long Night occurred, when the Others invaded. The event defined and shaped the North, leading to the founding of the Wall, the order of the Night''s Watch, the castle of Winterfell and the first Stark Kings of Winter. The Starks gradually defeated rival kings, such as the Barrow Kings to their south and the Red Kings to their east.[1] \r\n\r\nWhen the Andals invaded Westeros, the Stark Kings of Winter resisted them successfully, stopping them at Moat Cailin and the eastern shores, the only kingdom in Westeros to do so.[20][21] \r\n\r\nKing Jon Stark founded the Wolf''s Den at what is now White Harbor after driving out sea raiders.[9] His son, Rickard Stark, conquered the Neck from the Marsh King and married his daughter.[20] King Rodrik Stark is said to have won Bear Island from the ironborn in a wrestling match. Two thousand years ago the North warred with the Vale of Arryn after the Rape of the Three Sisters, with the Arryns eventually gaining control of the islands.[22] \r\n\r\nFor many centuries the Boltons were bitter rivals of the Starks of Winterfell. The practice of flaying their enemies gave the Boltons a sinister reputation. Approximately a thousand years ago, the Boltons finally swore fealty to the Kings in the North and agreed to abandon their practice of flaying their enemies. \r\n\r\nA thousand years before the Conquest, the Manderlys were driven from the river Mander by House Gardener of the Reach and fled to the North, where they were welcomed by the Starks of Winterfell as their own bannermen.[23] The Manderlys received the Wolf''s Den and developed White Harbor, one of the five cities of Westeros and the main northern port for commerce and naval transport. The Manderlys are the most prominent of the few northern noble houses to follow the Faith of the Seven instead of the old gods. \r\nTargaryen Era\r\n \r\nWinterfell Honor Guard by artist Tomasz Jedruszek. © Fantasy Flight Games.\r\n\r\nThe Starks led the North to war during the War of Conquest. After the Field of Fire, however, King Torrhen Stark knelt to Aegon the Conqueror rather than face his dragons. The North was included in the Seven Kingdoms and owed allegiance to the Iron Throne of House Targaryen. The Stark Kings in the North became the Lords of Winterfell and Wardens of the North. Some northmen who refused to bend the knee fled into exile in Essos and formed the Company of the Rose.[24] \r\n\r\nDuring the Dance of the Dragons, the Starks supported the blacks against the greens. Lord Roderick Dustin led two thousand northern soldiers, known as the Winter Wolves, during the war, while the Manderlys had knights from White Harbor also supported the claim of Rhaenyra Targaryen.[25] Lord Cregan Stark led a great host of northmen to King''s Landing, where he briefly ruled as Hand for King Aegon III Targaryen during the Hour of the Wolf.[26] \r\n\r\nLord Dagon Greyjoy led the ironborn in raiding the North during the reign of King Aerys I Targaryen; Lord Beron Stark gathered swords to repel them.[27] \r\n\r\nThe people of the North must be vigilant against wildlings who manage to bypass the Wall. One King-beyond-the-Wall, Raymun Redbeard, was defeated by the Starks and Umbers at Long Lake.[28] \r\n\r\nA century ago the Skagosi unsuccessfully rebelled against the Starks, costing the lives of the Lord of Winterfell and hundreds of his supporters.[10] \r\nRobert''s Rebellion\r\n\r\nThe northmen composed much of the rebel forces during Robert''s Rebellion, also known as the War of the Usurper. After King Aerys II Targaryen caused the deaths of Lord Rickard Stark and his heir, Brandon Stark, their successor, Lord Eddard Stark, led armies alongside Lord Robert Baratheon, who was chosen king at war''s end.'),
