,376.0,526.0,376.0,524.0,378.0,522.0,380.0,521.0,380.0,517.0,380.0,512.0,379.0,512.0,379.0,512.0', 3500, 'The crownlands are based around Blackwater Bay, with the capital of King''s Landing built where the Blackwater Rush meets the bay. King''s Landing, the largest city in Westeros, contains the Great Sept of Baelor and the Red Keep, the home of House Baratheon of King''s Landing. Settlements north of King''s Landing include Antlers (seat of House Buckwell), Rosby (seat of House Rosby), Stokeworth (seat of House Stokeworth), and Duskendale (seat of House Rykker), the region''s secondary port. Farther north are Rook''s Rest (seat of House Staunton) and Crackclaw Point, a rugged peninsula of insular folk whose castles include the Dyre Den (seat of House Brune), Brownhollow (another seat of House Brune), and the Whispers (formerly of House Crabb). North of Crackclaw Point are the Bay of Crabs and the Vale of Arryn.[3] \r\n\r\nThe crownlands are bordered to the northwest and west by the riverlands. A stream forms part of the boundary between the two regions, with the hills of House Wode in the riverlands and the lands of House Hogg in the crownlands.[4] An unnamed river flows south from Gods Eye into the Blackwater Rush in the western crownlands. Southwest of King''s Landing are hills around Tumbleton in the Reach.[3] \r\n\r\nSouth of King''s Landing is the kingswood, the royal hunting forest, and the stormlands. The Wendwater flows through the kingswood into the bay. East of the kingswood is Massey''s Hook, another peninsula that with Crackclaw Point forms the inlet of Blackwater Bay. Castles on Massey''s Hook include Stonedance (seat of House Massey) and Sharp Point (seat of House Bar Emmon).[3] \r\n\r\nIslands within Blackwater Bay include Dragonstone (another seat of House Baratheon), Driftmark (seat of House Velaryon), and Claw Isle (seat of House Celtigar). Also sworn to the Baratheons of Dragonstone is Sweetport Sound (seat of House Sunglass). Massey''s Hook is separated from Driftmark by the Gullet. East of Blackwater Bay is the narrow sea.[3] \r\n\r\nThe kingsroad connects King''s Landing with Storm''s End to the south and the crossroads to the north, while the capital is connected to Lannisport by the goldroad and to Highgarden by the roseroad.[3] With the exception of Crackclaw Point, the land is largely flat. Lying in the middle portion of Westeros, the crownlands possess a temperate climate.', 'In the Age of Heroes, the petty kings of House Darklyn ruled much of the future crownlands, from Duskendale to Crackclaw Point. Although neighboring realms forced them to swear fealty and their lands changed hands many times over the years, the Darklyns remained one of the more influential houses of the region. In the days of the Hundred Kingdoms, the mouth of the Blackwater was claimed by the Darklyns, the Masseys of Stonedance, and the river kings of Houses Mudd, Fisher, Bracken, Blackwood, and Hook.[6] Two centuries before the Wars of Conquest, the Targaryens of Valyria settled Dragonstone as the westernmost colony of the Valyrian Freehold, becoming another power in the region. \r\n\r\nIt was at the mouth of the Blackwater Rush, the later site of King''s Landing, where Aegon the Conqueror and his sisters, Visenya and Rhaenys, landed with their initial army. At that time the petty lords of the region had been subjugated by Harren the Black. Rosby and Stokeworth surrendered to Visenya and Rhaenys without fighting, while Aegon and his half-brother Orys Baratheon defeated the Darklyns and Mootons.[7] Massey''s Hook was controlled by the Storm Kings of House Durrandon, but the Bar Emmons and Masseys allied with Aegon against King Argilac the Arrogant.[6] \r\n\r\nSince the Conquest, the crownlands houses have historically been a strong source of support for House Targaryen, with Crackclaw Point being particularly fierce supporters. The Conqueror''s councillors included several crownlands men, including Crispian Celtigar, Daemon Velaryon, and Tristan Massey. Nobles from the region such as Qarlton Chelsted, a Hayford lord, and several Targaryens have served as Hand of the King, and even smallfolk of the region are near enough to catch the royal eye for such service, such as Rossart and presumably Septons Barth and Murmison. Nobles and smallfolk alike also provide much of the manpower for the City Watch of King''s Landing. The Kingsguard has also included many men of the crownlands, such as Duncan the Tall, Donnel of Duskendale, the Cargyll twins, Ser Rickard Thorne, at least six Crackclaw Pointers, and seven Darklyn knights. \r\n\r\nAt the start of the Dance of the Dragons, the Velaryons, supporters of Queen Rhaenyra Targaryen and the blacks, used their fleet to seal the Gullet and blockade King''s Landing. King Aegon II Targaryen''s supporters, the greens, retaliated by sacking Duskendale and Rook''s Rest. The greens later broke the blockade with the Battle in the Gullet and sacked Driftmark. Rhaenyra was eventually fed to Aegon II''s dragon, Sunfyre, at Dragonstone.[8] \r\n\r\nThe Defiance of Duskendale, a rising by the Darklyns during the reign of King Aerys II Targaryen, was a sign that even the normally loyal crownlands were losing respect for the dragonlords. Later, the outlaws of the Kingswood Brotherhood robbed nobles in the forest before being suppressed by the Kingsguard. King''s Landing was sacked by the forces of Lord Tywin Lannister during Robert''s Rebellion, also known as the War of the Usurper. After overthrowing Targaryen rule, the new king, Robert Baratheon, kept a crownlands presence among the White Cloaks by naming Ser Boros Blount to the order. Lingering Targaryen sympathies, meanwhile, were the reason that Robert named his brother, Stannis Baratheon, the new Lord of Dragonstone.'),
(3, 'Dorne', 'Dorne', '226,748,225,749,221,749,218,749,216,750,214,752,212,753,210,754,205,757,201,759,198,759,196,759,194,760,193,762,177,762,162,763,161,764,160,765,158,765,157,765,150,769,142,772,139,775,136,779,132,786,129,792,129,794,129,796,126,798,124,801,121,806,119,811,119,817,119,823,120,824,121,824,121,830,121,837,123,839,126,841,128,841,130,841,133,840,136,838,139,835,142,831,144,831,146,831,147,833,147,834,146,836,145,838,145,840,145,842,144,843,142,845,143,849,143,854,142,854,141,855,141,860,141,864,142,866,144,869,146,872,149,875,153,875,157,875,158,874,158,873,170,873,181,873,182,872,182,871,185,871,188,871,192,869,195,867,200,867,204,867,204,868,205,869,212,870,220,870,227,869,234,869,235,866,236,863,241,863,245,863,249,865,252,867,256,867,261,868,264,866,268,864,271,861,274,857,279,857,283,857,286,858,289,859,297,859,306,859,308,858,309,857,312,858,315,859,334,859,352,859,357,855,362,850,368,847,375,844,375,841,375,838,376,836,377,834,378,831,379,828,383,826,388,824,391,820,395,817,396,814,397,812,397,811,397,809,392,809,386,809,384,807,383,804,384,802,384,800,383,800,382,799,381,800,380,801,377,801,374,801,373,800,372,799,369,801,367,804,362,808,358,813,355,813,353,813,353,814,352,815,344,815,335,815,330,812,324,809,322,809,320,809,317,811,314,813,310,813,306,813,303,810,300,806,293,806,287,805,284,802,281,799,269,799,257,799,254,797,250,795,246,795,242,795,241,791,241,788,242,785,244,782,250,775,257,769,257,766,257,764,256,762,255,760,257,757,259,754,259,752,259,750,257,749,256,749,254,748,252,747,240,747,228,747', 4000, 'Dorne is the hottest region of Westeros. The region is rocky, mountainous, arid and dry, and features the only desert on the continent. Dorne is bordered by the Sea of Dorne to the north, the islands known as the Stepstones to the east, and the Summer Sea to the south. Stretched between them is the mountain range known as the Red Mountains, which separates Dorne from the stormlands to the north and the Reach to the northwest and west. There are two major passes, the Boneway and the Prince''s Pass, which go through the Red Mountains to the Dornish Marches of the stormlands. The Prince''s Pass leads to Nightsong, while the Boneway leads to Summerhall.[2] Sunspear and the Water Gardens, both controlled by the ruling House Martell, are located in southeastern Dorne. \r\n\r\nDorne''s rivers provide some fertile lands and even during a long summer there is enough rain and other supplies of water to keep Dorne habitable.[3] Inland water is almost as valuable as gold, and wells are jealously guarded. The major Dornish river is the Greenblood in southeastern Dorne, which is formed by the Vaith and the Scourge near Godsgrace. The trading port called Planky Town is located at the mouth of the Greenblood along the Summer Sea. The Brimstone in southern Dorne flows past the Hellholt to the Summer Sea. The Torentine has its source in the Red Mountains of western Dorne and ends at Starfall along the Summer Sea. The Wyl flows across the Boneway in northern Dorne to the Sea of Dorne. There is another river in northern Dorne which flows near Yronwood to the Sea of Dorne, but its name is as yet unknown.[2] \r\n\r\nThe southern coast is some four hundred leagues long. It is ridden with cliffs, whirlpools, and hidden shoals, with few safe landings.', 'The First Men settled Westeros by crossing the land bridge across the narrow sea called the Arm of Dorne. During their great war with the First Men, the children of the forest allegedly broke the Arm with the hammer of the waters in an attempt to stop them coming. \r\n\r\nFirst Men houses who established themselves as prominent kings included House Dayne, the Kings of the Torrentine; House Fowler, the Kings of Stone and Sky; and House Yronwood, the Bloodroyals who styled themselves High King of Dorne. A rival High King of Dorne was also chosen from a dozen houses along the Greenblood.'),
