(5, 'Gift', 'The Gift', '236,76,219,77,216,79,213,80,205,88,197,96,197,98,197,101,251,101,305,101,305,95,305,88,304,86,303,84,300,80,297,77,285,77,273,77,273,76,272,75,269,75,265,75,265,76,264,77,262,76,261,76,257,76,253,76', 100, 'The Gift is the area in the North stretching fifty leagues south from the Wall that was given to the Night''s Watch in perpetuity to support and aid the Watch.[1] It is under the protection of both the Watch and Winterfell.[2] The eastern lands of the Gift consist of large rolling plans that reach the Shivering Sea, while the western regions, which end at the Bay of Ice, are increasingly forested and mountainous.', 'Brandon''s Gift\r\n\r\nA Brandon Stark, usually mentioned as Bran the Builder but sometimes another Brandon, gave the land up to twenty-five leagues south of the Wall to the Night''s Watch for their sustenance and support.[1] Brandon''s Gift was farmed for thousands of years, but nature reclaimed many buildings and orchards as the Night''s Watch decreased in number.[2] \r\nNew Gift\r\n\r\nThousands of years later Queen Alysanne visited the Wall with her dragon, Silverwing. She held the Night''s Watch in great esteem and convinced her husband, King Jaehaerys I, to double the land, extending it out a further twenty-five leagues. The new territory was named the New Gift.[1] The villages that existed in the New Gift payed their taxes in goods and labor to the Night''s Watch, helping feed and provide food for the brothers. The New Gift contains many holdfasts, such as Queenscrown.[1][2] Of the northern mountain clans, the Norreys live closest to the New Gift.[4] \r\nWildings\r\n\r\nThe wildlings or free folk often enter the Gift to raid, steal, and carry off women of the North. Because of the frequency of raids, many people have fled south into the mountains or the lands of House Umber east of the kingsroad, leaving the villages and holdfasts abandoned.[1] \r\n\r\nLord Eddard Stark considered having new lords settled in the Gift to protect against the raids. Eddard believed the Lord Commander of the Night''s Watch would approve of the idea if the new lords paid taxes to Castle Black instead of Winterfell, but the plan would have to wait until after winter.'),
(6, 'Iron', 'Iron Isles', '57,409,54,411,53,414,53,417,52,418,52,419,52,420,52,422,48,425,45,427,41,428,37,429,36,448,36,467,39,474,42,482,42,485,42,489,44,490,46,490,47,492,49,494,51,498,53,502,63,502,73,502,74,503,76,503,76,501,77,499,79,499,82,499,83,498,84,497,84,492,84,488,85,488,87,488,89,490,91,492,95,492,99,492,102,491,104,490,104,489,104,488,106,488,108,487,109,484,111,481,111,479,111,477,110,470,109,464,109,463,108,463,101,462,95,462,94,456,94,451,88,450,82,450,82,445,82,440,83,440,84,440,84,436,84,432,83,432,82,432,82,429,82,427,75,426,69,426,66,424,64,421,64,415,64,408,62,408,60,407', 2000, 'The Iron Islands is an archipelago in Ironman''s Bay, located in the Sunset Sea off the western coast of Westeros. They are roughly west of the riverlands, northwest of the westerlands, and south of the North. \r\n\r\nThe main grouping of islands numbers thirty-one, with the seven major isles being Pyke, Great Wyk, Old Wyk, Harlaw, Saltcliffe, Blacktyde, and Orkmont. Eight days sail northwest of Great Wyk is a smaller grouping of thirteen clustered around the Lonely Light. Some of the Iron Islands are used for sheep grazing or are uninhabited.[1] \r\n\r\nThe Iron Islands is the smallest of the regions of the Seven Kingdoms. Dorne is the least populous of the Seven Kingdoms according to Doran Martell, but it is unclear if he is also including the Iron Islands in this estimate.[3] \r\n\r\nThe Iron Islands are small, barely-fertile rocks with few safe harbors. The seas around the islands are stormy, frequently wreaking havoc with their considerable force. \r\n\r\nThe islands are ruled from the island of Pyke, the seat of House Greyjoy. Pyke bears an ancient fortress of the same name built atop several natural rocky towers jutting out of the sea. Connected by treacherous rope bridges, it would be a major challenge for any invading army. Pyke once extended as a spur of land like a sword out of the sea, but that outcropping has long since shattered, and it is now in essence three separate isles.', 'Maesters believe the Iron Islands were settled by the First Men many thousands of years ago. Legends claim that the First Men discovered what would be called the Seastone Chair upon the shores of Old Wyk.[8] There is no evidence the islands were inhabited by children of the forest or giants, and humans worshipped the Drowned God instead of the old gods. The drowned men, the priests of the isles, claim the ironmen are not First Men but were created in the image of the Drowned God, and they therefore may have a connection with merlings.[1] \r\n\r\nFor much of their history, each island was its own kingdom and had its own two kings, a rock king who ruled the land and a salt king who commanded at sea. These petty kings, who were chosen by kingsmoot, raided the First Men of mainland Westeros for timber, crops, and thralls.[1] \r\n\r\nIn time, High Kings of the Iron Islands were chosen by kingsmoot on Old Wyk by the rock kings, salt kings, and longship captains. These high kings or driftwood kings began to conquer other lands instead of just raiding them. Under the rule of King Qhored the Cruel, the ironborn managed to bring much of the western coast of Westeros under the rule of the Iron Island, including lands as far as Bear Island, the Arbor, and Oldtown.[4] They were gradually lost by his successors, however, as mainland houses such as the Hightowers, Gardeners, and Lannisters increased in strength. The high kings came from numerous houses, with most coming from Houses Greyjoy, Goodbrother, and especially Greyiron.[12][13] \r\n\r\nFive thousand years ago, Urron Redhand slaughtered the rival claimants at a kingsmoot and established a hereditary throne. Instead of being a high king, Urron claimed the shorter title King of the Iron Islands, with all rock kings and salt kings becoming his lords and vassals. His Greyiron dynasty lasted a thousand years, until the Andals swept over the Iron Islands.[2][14] \r\n\r\nThe Greyirons were replaced as hereditary Kings of the Iron Islands by House Hoare, who intermarried with the Andals. The drowned men, the priests of the Drowned God, considered the Hoares ungodly and false kings, which Archmaester Hake agreed with. Archmaester Haereg, however, believed that the Hoares were disliked for tolerating the Faith of the Seven, discouraging reaving, and promoting trade. The drowned men eventually rebelled against King Harmund the Handsome and mutilated his mother, Dowager Queen Lelia Lannister, which led to a long war with the westerlands which left the Iron Islands impoverished and ill-prepared for the Famine Winter. It took centuries for the islands to recover, during which ironmen began to trade along coastal Westeros and the Free Cities. They also reaved in distant places such as the Basilisk Isles, Stepstones, and Disputed Lands, since mainland Westeros was increasingly fortified.[15] \r\n\r\nKing Qhorwyn the Cunning was peaceful but built a strong fleet to deter attack.[15] His ambitious son, King Harwyn Hardhand, conquered the Trident from the Storm King Arrec Durrandon.[4] Harwyn''s grandson, King Harren the Black, ordered the construction of Harrenhal, an enormous castle on the northern shore of the Gods Eye in the riverlands. The building of Harrenhal over forty years beggared both the Iron Islands and the riverlands.[16] \r\n\r\nThe Hoare line, the Kings of the Isles and the Rivers, ended with the deaths of Harren and his sons during the Targaryens'' War of Conquest. Inspired by Aegon Targaryen, Lord Edmyn Tully led the river lords in rebellion against the Hoares at Harrenhal.[17] Harren refused to yield to Aegon and the castle was too strong to storm, so Aegon rode his dragon Balerion over the walls and roasted King Harren and his sons in their tower.[18] With Harren''s death the river lords threw the ironborn back to their islands, and Aegon granted the riverlands to House Tully. In 2 AC Aegon invaded the Iron Islands and defeated the various pretenders to Harren''s throne. Aegon then allowed the defeated ironborn to choose Lord Vickon Greyjoy of Pyke to rule as the new Lord of the Iron Islands, a vassal of the Targaryens who now ruled the Seven Kingdoms from the Iron Throne.[13] \r\n\r\nLord Dalton Greyjoy, the Red Kraken, raided the the western shores during the Dance of the Dragons, capturing land from the westerlands. In 134 AC Lady Johanna Lannister allied with Ser Leo Costayne to invade the islands in reprisal.[13] During the reign of King Aerys I Targaryen, Lord Dagon Greyjoy, the Last Reaver, led the ironborn in again raiding the western coast of Westeros.[19][20][21] \r\n\r\nThe Iron Islands supported the Iron Throne during the War of the Ninepenny Kings. Lord Quellon Greyjoy was a peaceful ruler who outlawed thralldom and wanted to integrate the Iron Islands into the rest of the Seven Kingdoms. His son, Lord Balon Greyjoy, rejected his father''s works and wanted to return to the Old Way of paying the iron price. After constructing the Iron Fleet, he led an uprising of the Iron Islands against the Iron Throne in a bid for independence in 289 AC.[21] Greyjoy''s Rebellion was crushed by King Robert I Baratheon, however. Balon''s only surviving son, Theon Greyjoy, was taken to Winterfell as a ward of Robert''s friend, Lord Eddard Stark, the Warden of the North.'),
(7, 'Reach', 'The Reach', '192,600,187,606,187,607,187,608,184,611,181,613,181,616,181,619,179,621,177,624,177,625,177,626,173,630,169,634,162,636,156,638,151,639,146,640,132,641,119,642,117,642,115,643,109,646,104,648,103,650,102,651,101,651,99,651,98,653,97,654,91,657,86,659,74,659,62,659,61,661,61,662,63,664,65,667,65,668,65,670,64,671,63,671,63,676,63,681,67,685,71,689,71,691,71,693,72,694,73,695,76,695,79,695,83,699,88,703,91,703,94,703,97,705,99,706,99,707,99,709,103,713,107,716,107,718,107,720,105,722,102,723,101,722,99,721,96,722,92,723,91,724,91,725,95,729,99,732,99,735,99,738,97,739,95,740,93,739,90,739,88,737,87,735,84,735,81,735,80,737,78,739,75,744,73,748,73,753,73,757,71,759,69,762,64,762,59,762,56,766,53,770,53,771,53,771,51,774,50,776,50,782,49,787,52,789,54,790,54,793,54,795,53,796,51,797,53,802,55,807,60,809,64,811,69,808,74,806,75,805,75,804,79,803,82,801,84,802,85,804,83,810,81,816,78,819,75,822,75,824,75,827,74,828,73,828,73,830,73,833,82,841,90,850,91,852,93,855,95,854,98,854,104,854,110,853,113,852,116,850,117,849,118,847,120,847,121,847,121,846,122,844,119,840,117,835,115,829,113,823,114,820,115,817,117,809,119,802,120,801,121,801,121,798,121,796,123,792,125,788,125,786,125,785,129,781,132,777,133,777,135,777,139,772,144,768,150,765,156,762,160,761,165,759,168,759,172,759,175,758,177,757,177,756,177,755,176,751,175,748,177,745,179,742,179,741,179,739,183,734,188,730,192,728,197,726,201,725,206,724,210,723,214,722,218,721,223,720,228,719,234,718,239,717,244,716,248,715,253,714,256,713,259,713,262,709,266,706,268,701,271,696,272,694,272,692,273,683,274,674,275,660,276,647,277,643,278,640,274,636,271,633,270,633,269,633,260,624,252,616,248,614,245,613,240,608,235,603,229,602,224,600,219,599,215,598,210,597,206,596,201,595,197,595', 1500, 'The Reach is the most fertile part of Westeros and has numerous and well-populated villages and towns. The Sunset Sea is found to the west, while the hills of the westerlands are to the northwest and the Blackwater Rush of the riverlands is to the north. The Reach borders the crownlands to the northeast, while to the east and southeast are the stormlands and their Dornish Marches. South of the Reach are the Red Mountains of Dorne and the Summer Sea. The Roseroad links Oldtown with King''s Landing by way of Highgarden, while the Ocean Road links Highgarden with Lannisport.[2] \r\n\r\nThe Reach is watered by the immense river Mander and its tributaries, including the Blueburn and the Cockleswhent. The Reach proper is centered around the Mander.[3] Oldtown is located at the mouth of the Honeywine. The region also includes several islands, including the Shield Islands near the mouth of the Mander and the Arbor south of the Whispering Sound and the Redwyne Straits.', 'House Gardener\r\n\r\nThe beginnings of the Reach can be traced back to Garth Greenhand, the legendary High King of the First Men who lived in the Age of Heroes.[6] The royal line of House Gardener of Highgarden claimed descent from Garth as do many current houses in the region.[7][8] What is now the Ravenry of the Citadel is said to have been a pirate stronghold during the Age of Heroes.[9] \r\n\r\nThe Reach is the home of mythical warriors and knights such as Serwyn of the Mirror Shield, Davos the Dragonslayer, Roland of the Horn and the Knight Without Armor.[10] \r\n\r\nThe Reach is the heart of the chivalric tradition in the Seven Kingdoms, the place where knighthood is most universally esteemed. Tourneys here have the most elaborate and varied rules, and are the most likely to be held for knights only. \r\n\r\nDornishmen have warred against the Reach for thousands of years; rivalries include the feud between House Oakheart and House Dayne.[11] The Kings of the Reach also warred with the Storm Kings of House Durrandon, gradually conquering land from the western stormlands. However, King Garse VII Gardener was slain by King Argilac Durrandon in the Battle of Summerfield.[12] The Dornish Marches, the lands just north of the Red Mountains of Dorne, have long been disputed. The lords of Highgarden count Defender of the Marches amongst their titles,[13] although most of the marcher lords now owe allegiance to House Baratheon of the stormlands. \r\nHouse Tyrell\r\n\r\nDuring the War of Conquest, King Mern IX Gardener led the army of the Reach against the invading House Targaryen, but he was killed at the Field of Fire and his line was ended. House Tyrell, the stewards of the Gardeners, surrendered Highgarden to Aegon the Conqueror. They were rewarded with both the castle and the position of overlords of the Reach. The High Septon and Lord Banfred Hightower did not oppose Aegon when he approached Oldtown, increasing the new king''s legitimacy.[14] Rather than being independent, the Reach was part of the Seven Kingdoms ruled by the Iron Throne. \r\n\r\nDuring the Dance of the Dragons, the Reach was split between the greens and the blacks, with the Hightowers providing much of the support for the greens (along with the Redwynes), but with the Rowans, Tarlys, Costaynes, Mullendores, and Grimms supporting the blacks. The Battle on the Honeywine and the First and Second Battles of Tumbleton were fought in the Reach. \r\n\r\nIn the First Blackfyre Rebellion, several of Daemon I Blackfyre''s greatest supporters were men of the Reach, including Ser Quentyn Ball and Lord Gormon Peake, while others supported Daeron II Targaryen. \r\n\r\nRobert''s Rebellion saw the Reach provide much of the pro-Targaryen strength. Lord Randyll Tarly led the van of Lord Mace Tyrell to victory against Lord Robert Baratheon in the Battle of Ashford. After Ashford, Mace led the unsuccessful Siege of Storm''s End.'),
(8, 'Riverlands', 'Riverlands', '205,402,203,404,198,404,194,404,194,405,193,406,191,406,188,406,188,407,187,408,178,408,168,408,165,410,162,411,162,413,162,415,158,419,155,422,154,422,153,422,152,420,151,419,150,420,148,421,148,426,148,431,149,432,150,432,150,436,150,440,148,442,146,443,146,445,146,446,144,446,142,446,142,447,142,448,138,449,134,450,134,455,135,460,140,460,146,460,146,459,146,458,148,458,150,458,150,457,150,456,152,456,154,456,154,455,154,454,156,454,158,454,159,453,159,452,162,452,165,452,167,455,169,457,171,460,174,463,174,468,174,473,174,475,174,476,171,479,169,482,166,482,164,482,160,485,156,487,156,490,156,493,159,495,161,498,163,501,164,505,165,506,166,508,166,510,166,512,167,513,168,513,168,518,168,522,170,522,171,522,172,522,173,523,175,525,176,528,175,530,173,532,171,532,168,532,166,536,164,540,164,542,164,544,163,546,162,548,161,550,160,552,160,555,160,559,162,561,164,564,165,565,167,566,169,567,171,568,173,568,175,568,184,577,193,586,194,588,195,590,200,590,205,590,208,593,212,596,216,596,221,596,223,595,225,594,229,594,234,595,240,602,246,609,246,610,247,612,250,612,254,612,255,611,255,610,257,610,259,610,264,606,268,601,268,600,268,598,269,598,270,598,270,593,270,587,273,585,276,583,276,582,276,581,284,574,291,566,292,566,293,566,297,563,300,559,300,558,300,556,301,556,302,556,302,550,302,544,301,544,300,544,300,542,300,541,297,539,294,538,291,537,289,536,287,535,285,534,284,534,282,534,279,531,276,527,276,526,276,525,274,524,272,522,272,520,272,518,271,518,270,517,270,513,270,509,266,506,262,502,262,501,262,499,259,497,256,494,256,493,256,491,254,489,251,487,245,475,239,463,235,459,231,455,229,451,228,448,227,446,226,444,226,441,226,438,225,438,224,437,224,424,224,411,222,410,221,409,220,406,219,404,217,404,216,404,213,402,211,400,208,400,206,400', 10000, 'The riverlands encompass a region of plains, forests, hills, and endless rivers. Their northern border is near the swamplands of the Neck, the southernmost region of the North. To the east, the riverlands extend to the Vale of Arryn''s Mountains of the Moon and Crackclaw Point in the crownlands. A stream forms part of the boundary between the riverlands and the crownlands, with the hills of House Wode in the former and the lands of House Hogg in the latter.[9] To the south the riverlands border the crownlands and the Reach. The riverlands extend west to Ironman''s Bay and the mountainous westerlands. The heavily fortified Golden Tooth guards the entrance to the riverlands but belongs itself to the westerlands.[10] Some of the eastern hills of what are now the westerlands were once ruled by Kings of the Rivers and the Hills, such as the Mudds and Teagues.[5] Some river kings also fought over territory with the Kings of the Reach to the south.[11] \r\n\r\nThe riverlands are named for the number of rivers which are present. The Red Fork runs from its source in the western mountains to Riverrun where it combines with the Tumblestone and then runs to the east. The Blue Fork flows southeast from its sources near Seagard, while the Green Fork runs south from swamps in the Neck, near the kingsroad. The three forks come together a short distance from Lord Harroway''s Town to form the Trident, which then pours into the Bay of Crabs at Saltpans. The northern Blackwater Rush and a river from the Gods Eye run through the southern riverlands. \r\n\r\nThe riverlands do not contain any major cities, but have a number towns, such as Fairmarket, Harrentown, Harroway, Maidenpool, Saltpans, and Stoney Sept. Their major castles include Darry, Harrenhal, Raventree Hall, Riverrun, Seagard, Stone Hedge, and the Twins. Additional noteworthy places in the riverlands are the old ruins at Oldstones, where in ancient times House Mudd had its castle, and the Gods Eye lake with the Isle of Faces in it. The Lady of the Leaves lives in a village hidden in trees, while a ghost is said to be at High Heart.[12] The Quiet Isle is located at the mouth of the Trident', 'First Men\r\nSee also: Dawn Age, and Andal invasion\r\n\r\nDuring the Dawn Age the First Men settled in the riverlands, coming into conflict with the native children of the forest. After centuries of fighting, a pact was signed at the Isle of Faces, the children withdrew to their forests, while the First Men raised their kingdoms in the lands ceded by the mysterious folk.[17] \r\n\r\nDuring the thousand years that followed, various families ruled the riverlands as river kings, claiming the titles King of the Trident or King of the Rivers and the Hills. Many dynasties claimed these lands during the Age of Heroes, including the Fishers, Brackens, the Blackwoods and the Mudds, who were the last of the First Men to claim the riverlands as their own.[18][19] \r\n\r\nThe time of the First Men river kings came to an end with the Andal invasion. Remembered in song are the Fall of Maidenpool, the Widow''s Ford, the White Wood, and the Battle of Bitter River.[5] King Tristifer IV Mudd raised his armies and met the Andal invaders. Tristifer was said to have won 99 out of his 100 battles against the Andals; in the final battle he was killed. His son and successor, Tristifer V, was not as successful as his father and the kingdom fell.[20] \r\nAndals\r\n\r\nThe Andals then raised their own kingdoms and dynasties. House Justman united the riverlands for almost three centuries, but the sons of King Bernarr II Justman were murdered by Qhored Hoare in the Bloody Keep of Pyke in the Iron Islands.[21] The riverlands were then disputed by Houses Blackwood, Bracken, Vance, Mallister, and Charlton for a century. The Hooks were also river kings of old who claimed the mouth of the Blackwater Rush.[4] The various kings were pressured by the Kings of the Iron Islands, the Kings of the Rock, the mountain clans, the Kings of the Reach, the Storm Kings, and pirates from the Stepstones and the Three Sisters. House Teague finally reunited the riverlands, but they were disliked by their rebellious subjects.[5] \r\nStorm Kings\r\n\r\nThe last native kings, the Teagues, were killed by the Storm King Arlan III Durrandon in the Battle of Six Kings[2] about 360 years before Aegon''s Landing. Several leaders such as Lucifer Justman, Marq Mudd, Lord Robert Vance, Lord Petyr Mallister, Lady Jeyne Nutt, Ser Addam Rivers, Pate of Fairmarket and Ser Lymond Fisher, rose in rebellion and even reigned, albeit for a short time, before being put down by the might of Storm''s End.[5] \r\nHouse Hoare\r\n\r\nThe Storm Kings in turn were defeated by the Iron King, Harwyn Hardhand, who established his own kingdom from the Iron Islands to the riverlands. The era of the Kings of the Isles and the Rivers is included in The Iron Chronicle. Harwyn''s son, Halleck Hoare, made his seat in Fairmarket instead of the Iron Islands.[2] \r\n\r\nHarwyn''s grandson, Harren the Black, ordered the construction of an immense castle, Harrenhal, as a display of his wealth and power. Construction of Harrenhal took forty years and a huge amount of resources and money to build. Feuding between the Blackwoods and the Brackens during the construction led Harren to punish both houses. Ironically, the same day the most immense castle in history was finished, Aegon I Targaryen landed in Westeros with his dragons. \r\nThe Conquest\r\n\r\nHarren the Black was unpopular within the riverlands when Aegon invaded Westeros. Rather than support the Hoares against the Targaryens, the river lords rose in rebellion and joined the invaders. The first to do so was House Tully, followed by the Blackwoods, Mallisters, Vances, Brackens, Pipers, Freys, and Strongs.[2] \r\n\r\nHarren thought if he refused battle Aegon would have to lay siege to the castle with the river lords. Instead, Aegon let his dragons attack. The heat produced by the dragons was so great that much of Harrenhal burned and melted, killing Harren and his children. After the burning of Harrenhal Aegon raised Lord Edmyn Tully to dominion over the riverlands, below the sovereignty of the Targaryens, as the Lord Paramount of the Trident.[2] The Inn of the Kneeling Man on the Red Fork was built where Torrhen Stark, King in the North, is believed to have submitted to Aegon.[15] \r\nTargaryen Era\r\n\r\nWhen the Dance of the Dragons began, the river lords were notoriously quarrelsome and nominally under the rule of House Tully. Most of the river lords supported Rhaenyra Targaryen and the blacks against Aegon II Targaryen and the greens. Prince Daemon Targaryen quickly took Harrenhal and followed up with victories at the Burning Mill and Stone Hedge. The green army from the westerlands was defeated by three forces from the riverlands and the North in the Battle by the Lakeshore. In response, Prince Aemond Targaryen and his dragon, Vhagar, burned much of the riverlands,[22] but Aemond was eventually killed at the Gods Eye by Prince Daemon. Ser Criston Cole, the Kingmaker, led an army of greens through the riverlands, but they were hampered by the scorched earth tactics of the river lords. The rivermen and their northern allies crushed Cole and his greens in the Butcher''s Ball, an ambush south of the Gods Eye.[7] \r\nRobert''s Rebellion\r\n\r\nDuring Robert''s Rebellion Lord Hoster Tully took the side of the rebels; he was already connected with them through the engagement of his daughter Catelyn to Brandon Stark. After Brandon''s death, Hoster had Catelyn married to Brandon''s younger brother Eddard and his younger daughter Lysa married to Jon Arryn. A number of Lord Tully''s vassals remained loyal to the Targaryens, including Lords Darry, Mooton, Goodbrook, and Ryger. Lord Walder Frey arrived late to the Trident in support of the rebels. The Battle of the Trident, which ultimately determined the outcome of Robert''s Rebellion, was fought in the riverlands.'),
(9, 'Stormlands', 'Stormlands', '357,639,355,641,344,641,333,641,329,642,326,643,324,642,323,640,321,642,319,643,313,643,308,642,306,641,305,639,297,639,289,638,287,639,285,639,285,642,285,644,284,645,283,645,283,647,283,649,281,651,279,654,279,671,279,688,275,696,272,703,267,707,263,711,263,713,263,714,260,716,258,719,255,720,252,721,244,721,237,721,229,724,222,726,213,727,205,728,201,729,198,729,195,732,192,735,190,735,188,736,187,738,187,740,185,741,184,743,182,747,181,751,181,753,181,755,183,756,184,757,187,757,191,756,196,755,202,755,207,752,212,750,213,749,213,748,218,746,223,744,227,743,231,742,240,742,249,742,255,743,261,745,262,747,264,748,265,750,267,753,273,752,279,752,283,752,287,752,289,751,290,750,291,747,292,745,295,745,297,745,300,748,303,750,303,752,303,753,305,755,308,757,311,757,314,757,318,755,322,753,330,753,339,753,342,755,346,757,348,760,350,763,354,763,359,763,361,761,363,760,364,752,365,745,369,740,373,736,376,736,379,735,385,729,391,723,391,721,391,719,389,719,386,718,383,720,380,721,378,721,376,721,373,723,370,725,368,724,367,723,362,719,358,715,356,715,355,716,353,718,352,721,349,721,346,721,344,718,341,715,336,715,331,715,329,713,326,711,325,707,325,703,328,699,332,696,336,695,340,695,344,695,349,695,349,689,349,683,351,682,353,680,353,676,353,671,351,670,349,668,349,666,350,664,357,663,364,663,366,661,368,660,370,657,371,654,371,652,371,650,373,647,375,644,375,642,375,640,370,639,365,638,362,638,360,637', 5000, 'The stormlands are bordered to the north by the crownlands, west by the Reach, south by Dorne and the Sea of Dorne, and east by Shipbreaker Bay and the narrow sea. They are one of the smaller regions of Westeros, a land of harsh mountains, stony shores, and verdant forests, including the kingswood and the rainwood along Cape Wrath. Major rivers include the Slayne and part of the Wendwater.[2] \r\n\r\nThe Dornish Marches, located in the south-west in a long salient along the Red Mountains, serve as an effective buffer zone between the stormlands and their old enemies of the Reach and Dorne. For centuries it was a regular battleground, changing hands more than once until Dorne became part of the Seven Kingdoms. \r\n\r\nA few islands, including Tarth and Estermont, are also considered part of the stormlands. Ships coming across the narrow sea avoid the notorious Shipbreaker Bay and its storms, though the seas along the stormlands can be clear and blue. The waters around Tarth are particularly famed for their clear blue color, earning Tarth the name "Sapphire Isle."', 'The stormlands were the domain of the Storm Kings of House Durrandon, whose territory in eastern Westeros once stretched from Cape Wrath to the Bay of Crabs.[6] King Arlan III Durrandon vanquished the river kings of House Teague, extending the Storm Kings'' domain north to the Neck.[7][2] For thousands of years the Dornish Marches of the stormlands were the first line of defense against Dornish incursions from the south, so they have strong martial traditions and a number of strong castles, especially the marcher lords.[3] \r\n\r\nHowever, the power of the Storm Kings declined over centuries due to pressure from the Kingdom of the Reach to the west and Dorne to the south.[6] The Storm King Arrec Durrandon lost the riverlands to Harwyn Hardhand of the Iron Islands.[7] Arrec''s grandson, King Argilac Durrandon, killed King Garse VII Gardener at Summerfield and also fought alongside Pentos and Tyrosh against Volantis during the Century of Blood.[8][6] \r\n\r\nArgilac the Arrogant was the last Storm King, however, as he was slain in the Last Storm during Aegon Targaryen''s War of Conquest. Argilac''s lands, titles, sigil, and house words were given to Orys of House Baratheon, who married Argilac''s daughter, Argella Durrandon. Under Targaryen rule, the Baratheon storm lords continued to battle the Dornishmen until their incorporation into the Seven Kingdoms by King Daeron II Targaryen. \r\n\r\nRobert''s Rebellion saw the Baratheons raise a rebel alliance against Targaryen rule. When Lord Robert Baratheon returned from the Vale of Arryn to call his banners, he first had to defeat his recalcitrant bannermen at Summerhall before marching north to his eventual victory at the Trident. Robert''s middle brother, Stannis, defended Storm''s End during a siege by Lord Mace Tyrell of the Reach. Robert claimed the Iron Throne, forming the royal House Baratheon of King''s Landing. Stannis took and was given Dragonstone, while the youngest brother, Renly, succeeded Robert as Lord of Storm''s End.'),
