1,353,422,351,422,348,422,348,423,347,424,342,424,338,424,338,425,338,426,337,426,335,426,333,428,331,430,330,430,328,430,328,431,328,432,326,432,323,432,322,430,322,429,328,422,335,416,340,416,344,416,345,415,345,414,348,414,350,414,351,413,351,412,354,412,356,412,356,411,356,410,357,410,359,410,361,408,363,406,364,406,364,406,369,401,374,397,373,395,371,394,370,394,368,394,367,396,366,398,364,398,362,398,362,399,362,400,361,400,359,400,357,402,355,404,354,404,352,404,352,402,352,400,350,400,348,400,348,401,348,402,346,402,344,402,344,403,344,404,342,404,339,404,338,403,338,401,339,400,341,398,342,398,343,398,345,395,348,392,348,391,347,389,344,390,341,390,340,389,340,387,342,385,345,382,346,382,347,382,348,380,350,378,350,377,349,376,347,376,345,376', 2500, 'The borders of the Vale are held to be the Bite to the north, the Bay of Crabs to the south, the Mountains of the Moon and then the riverlands to the west, and the narrow sea to the east. The Vale consists of various regions: the Vale of Arryn itself; the Mountains of the Moon; the snakewood; the Fingers; and the islands of the Three Sisters, the Paps, and Pebble. \r\n\r\nThe Vale is located on the eastern shore of Westeros, a land of fertile soil, rivers, and lakes, protected by its largely impassable Mountains of the Moon. The Vale tends to be slightly isolated from the rest of Westeros. Its harsh winters make travel only possible through the mountains during warmer years, and rebellious mountain clans make travel even more dangerous. The Vale can be reached through the high road, which connects the Vale and the riverlands, and is protected by the Bloody Gate. \r\n\r\nThe mountainous border of the Vale of Arryn proper appears to include the Bloody Gate in the west and the Eyrie and Longbow Hall to the north. The fertile lands within the valley include Ironoaks, Old Anchor, Redfort, and a peninsula containing the city of Gulltown and Runestone. The town of Wickenden is located along the Bay of Crabs, in the mountains south of the valley. Castles north of the Vale proper in the valleys of the Mountains of the Moon and the snakewood forest[3] include Coldwater, Heart''s Home, Snakewood, and Strongsong.', 'During the Age of Heroes, the Vale was thinly populated and was ruled by a score of petty First Men kings. The Winged Knight is among the legendary heroes of the Valemen from thousands of years ago.[8] \r\n\r\nThe Vale was where the Andals landed when they began their invasion of Westeros. Rather than unite against the newcomers, many of the First Men rulers sought alliances with the Andals, often with disastrous results.[9] House Arryn claimed the Vale after defeating the First Men in the Battle of the Seven Stars.[9] As such, the Arryns are one of the oldest lines of Andal nobility in the Seven Kingdoms. The Arryns ruled as Kings of Mountain and Vale for approximately six thousand years. Those First Men who did not accept Andal rule fled into the Mountains of the Moon, becoming the mountain clans.[9] \r\n\r\nFollowing the Rape of the Three Sisters two thousand years ago, the Vale warred with the North for a thousand years.[10] The Wolf''s Den was besieged by Osgood Arryn and burned by the Talon during the wars between the two kingdoms.[11] The Three Sisters swore fealty to the Arryns, although their loyalty is tenuous.[10] \r\n\r\nThe Arryns bent the knee to Aegon the Conqueror during the Targaryens'' War of Conquest, bringing the Vale under the control of the Iron Throne.[6] During the Dance of the Dragons, Jacaerys Velaryon gained the Vale for the cause of the blacks.[12] The Vale remained loyal to the Targaryens during the First Blackfyre Rebellion.[13] The Arryns blocked access to the Vale during the Great Spring Sickness.[13] \r\n\r\nRobert''s Rebellion began in the Vale, when Lord Jon Arryn refused to surrender his wards Robert Baratheon and Eddard Stark to King Aerys II Targaryen. Defeating his royalist bannermen at Gulltown, Lord Arryn went on to help Robert secure the Iron Throne, and was named his Hand after the war. In Lord Arryn''s absence, Nestor Royce governed as High Steward of the Vale.'),
(11, 'Westerland', 'Westerland', '153,496,151,498,149,501,146,504,142,504,138,504,138,503,137,502,134,502,130,502,127,504,123,506,117,506,110,506,110,505,109,504,105,504,100,504,97,506,94,507,94,509,94,510,97,514,99,517,99,521,99,526,98,528,96,530,96,532,96,534,94,535,91,536,91,539,91,542,90,543,89,543,89,545,89,548,88,550,86,552,86,557,86,562,82,566,78,571,75,571,72,571,65,577,59,583,56,584,54,585,54,587,54,589,51,592,49,595,50,596,51,597,56,595,61,593,63,591,65,589,69,589,73,590,73,597,73,605,72,606,71,607,71,610,71,612,68,615,65,617,65,621,65,625,66,626,67,626,67,630,67,633,66,635,65,638,62,641,59,644,59,649,60,655,73,655,87,655,93,653,98,650,99,649,100,647,102,647,103,647,105,645,106,643,108,643,109,643,112,640,114,637,129,637,143,637,144,636,144,635,150,635,155,635,156,634,156,633,159,633,161,633,162,632,162,631,164,631,167,631,170,628,173,624,173,622,173,620,174,620,175,619,175,617,175,615,177,612,178,609,180,608,181,607,181,606,181,604,186,600,190,596,192,592,193,589,185,581,177,574,176,573,175,573,173,571,171,570,167,568,163,566,161,563,159,560,159,555,159,550,160,550,161,549,161,546,161,542,162,542,163,541,163,530,163,520,162,518,161,516,162,514,163,512,163,508,163,504,161,502,160,500,159,498,158,496,157,495,156,495', 1400, 'The westerlands lies along the coast of the Sunset Sea, with Ironman''s Bay and the Iron Islands to the north.[4] Settlements on the western coast include Banefort, the Crag, Faircastle on Fair Isle, Kayce, Feastfires, Casterly Rock with Lannisport, and Crakehall. Hills and mountain ranges are spread throughout the westerlands, with inland castles near the Rock including Ashemark and Sarsfield.[5] \r\n\r\nThe headwaters of the Tumblestone and the Red Fork flow east into the riverlands. The main pass through the eastern mountains is guarded by the Golden Tooth, a castle which controls access to the river road leading to Riverrun. Further south is the Goldroad, which runs east to King''s Landing. Deep Den watches the Goldroad, with Hornvale to the north and Silverhill to the south.[5] \r\n\r\nThe southern westerlands, which borders the Reach, contains more flatland than the rest of the country and includes Cornfield and the forest by Crakehall. The Ocean Road leads south from the Rock past Crakehall to Old Oak and Highgarden in the Reach.[5] \r\n\r\nBecause of the numerous hills and mountains, the westerlands'' eastward border with the riverlands is easily defensible. However, the westerlands is potentially vulnerable to attack from the Sunset Sea or the south as the coast is quite flat and can be more easily invaded.', 'Before the Andals\r\n\r\nLittle is known of the time before the coming of the First Men. Like the rest of Westeros, the children of the forest and giants lived in the westerlands and fought with the First Men when they came. After the Pact at the Isle of Faces, the children only kept the forests.[8] \r\n\r\nFirst Men lords, some of whom were petty kings, included the Baneforts, Brooms, Crakehalls, Farmans, Footes, Greenfields, Hawthornes, Morelands, Plumms, Reynes, Westerlings, and Yews.[8] \r\n\r\nDuring the Age of Heroes, the legendary hero and trickster Lann the Clever acquired Casterly Rock in some manner from House Casterly. According to legend he is the ancestor of the Lannisters, who became the Kings of the Rock with Casterly Rock as their seat. \r\nKingdom of the Rock\r\n\r\nThe Lannister Kings of the Rock gradually conquered or acquired neighboring territory, including the lands of the Reynes and the Baneforts. They initially resisted the Andal invasion, but later Lannister kings allowed the Andals to marry into the westermen nobility. New houses formed by the intermarriages included Houses Brax, Drox, Jast, Kyndall, Lefford, Marbrand, Parren, Sarsfield, and Serrett. In contrast to most kings of First Men origin, the support of the Andals allowed the Kings of the Rock to expand their power. When King Gerold III Lannister died without male issue, a council crowned his daughter''s husband, Ser Joffrey Lydden, who became the first Andal King of the Rock, Joffrey Lannister. \r\n\r\nWith Andal support the Lannisters extended their rule to the Golden Tooth and Fair Isle and engaged in border wars with the Kings of the Trident and Kings of the Reach.[8] Some of the eastern hills of what is now the westerlands were historically ruled by Kings of the Rivers and the Hills, such as the Mudds and the Teagues.[9] \r\n\r\nSer Eustace Osgrey mentioned that a famous relative of his defeated an attack by the Kingdom of the Rock by killing a Lannister king, Lancel V. The westermen also fought with the ironborn of the Iron Islands.[10] \r\nTargaryen Era\r\nSee also: War of Conquest\r\n\r\nDuring the invasion of Aegon Targaryen, Loren I Lannister, King of the Rock, mustered his armies to fight the invaders. Allied with Mern IX Gardener, King of the Reach, they assembled an enormous host, remembered as the Host of the Two Kings. However, they were no match for Targaryen dragons. King Loren escaped the so-called Field of Fire and submitted to Aegon. His primacy in the westerlands was confirmed by the Targaryens. Since this time the westerlands have been part of the Seven Kingdoms controlled by the Iron Throne. \r\n\r\nDuring the First Blackfyre Rebellion, some westerland houses kept a foot in both camps. It is mentioned that some nobles supported Daemon Blackfyre, but no westerland supporters of Daeron II are mentioned. It is unknown if this means the westerlands only supported Daemon Blackfyre. \r\n\r\nDuring the Great Spring Sickness the coast of the westerlands suffered under the attacks of raiders of Dagon Greyjoy. \r\nTytos Lannister\r\n\r\nDuring the rule of Lord Tytos Lannister, the power of House Lannister was nominal. Tytos was held in low esteem and was largely ignored by his vassals. House Tarbeck and House Reyne eventually revolted against his rule. Tytos''s son, Tywin, led the campaign against the Reyne-Tarbeck Rebellion. Houses Tarbeck and Reyne were extinguished; their respective seats at Tarbeck Hall and Castamere were razed. Since this time no house dares oppose House Lannister in the westerlands. Because of this unity, the westerlands are a force to be reckoned with. Tywin''s own prestige was so great and his capabilities so well demonstrated that he became Hand of the King for King Aerys II Targaryen, although he later resigned from the position. \r\nRobert''s Rebellion\r\nMain article: Robert''s Rebellion\r\n\r\nAfter the apparent abduction of Lyanna Stark, who was betrothed to Lord Robert Baratheon, by Crown Prince Rhaegar Targaryen and the execution of her father and brother by King Aerys II, a rebellion of House Stark, House Arryn, House Baratheon, and House Tully against House Targaryen began. \r\n\r\nFor the better part of the War of the Usurper the westerlands remained neutral. After the Battle of the Trident and the death of Rhaeger, however, Tywin chose the side of the rebels. The westermen army sacked King''s Landing, and killed the Targaryen heirs to prove their support. After being crowned king, Robert Baratheon married Cersei Lannister to bind the Lannisters to his cause.');

